import React from "react";
import AboutImg from "../images/about-img.svg"
import ContactUs from "./ContactUsAbout";
import Nav from "./Nav";
import Footer from "./Footer";


function About() {
  return (
      <React.Fragment>
    <div className="about-container">
      <div className="about-content">
        <h2>About us</h2>
        <h4>Who we are?</h4>
        <p>
          We are physicians and engineers striving to strengthen healthcare
          connections, by building platforms rooted in the humanity of medicine
          and enabled by modern software technologies.
        </p>
        <h4>Mission</h4>
        <p>
          Our aim is to enable urgent care clinics to better serve the health
          needs of their community, by partnering with clinics to optimize
          operational workflow and serving as connectors fostering trust and
          engagement.
        </p>
      </div>
      <img src={AboutImg} alt="img about"></img>
    </div>
    </React.Fragment>
  );
}

export default About;
